        <div>
            <button>{props.namebutton}</button>
            <p>Nome:{props.name}</p>
            <p>Sobrenome:{props.lastname}</p>
            <p>Idade:{props.idade}</p>
            <button onClick={props.click()}>Botao</button>
            <button onClick={alerta}>botao de botao</button>
        </div>
    )
}
